/*
 * Discogs - BurnOmania's BRUSHED Style v0.1.1
 *
 * Author      : tHe ReaLiZeR
 * Updated     : February 10, 2008
 * Description : REDESIGN LINKS - REMOVE UNDERLINES FROM ANY LINKS.
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 * Thanks to   : N/A yet :)
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.discogs.com") {

/* CHANGE GLOBAL FONT */
*{ font-family: "Segoe UI", Ariel !important; }

/* CHANGE GLOBAL BACKGROUND */
*{background: url("
data:image/jpeg;base64,
") fixed top #939393 repeat !important;}


/* Defaults for All Links */
a:link { color: #0000ff !important; }
a:visited { color: #cc0a0e!important; }
a:active { color: #fff!important; }
a:hover { color: WHITE !important; }

/* Make Sure Web Forms Won't Changed (Colors & Fonts) */
input *, textarea *, .aAutoComplete { background-color: 
#000 !important; color: BLACK !important; font-size: 10pt 
!important; }

/* Web Forms Stylish */
  input {
    padding: .1em .2em !important;
  }
  input:not([type="submit"]), select {
    background: #F5F9FB !important;
    border: 1px solid #F0F2F7 !important;
    color: #330000 !important;
    padding: 1px 8px !important;
    -moz-border-radius: 20px ! important;
  }

  input[type="submit"], input[type="button"] {
    background:#F5F9FB !important;
    border: 1px solid #F0F2F7 !important;
    -moz-border-radius: 20px ! important;
    color:#123!important;
    cursor:pointer !important;
    margin:.3em .4em 0 !important;
    padding:.1em .2em !important;
  }

/* REDESIGN LINKS - REMOVE UNDERLINES FROM ANY LINKS */
* { text-decoration: none !important; }

}
